import React, { useState } from "react";
import LoginPage from "./LoginPage";
import Chat from "./Chat";

function App() {
  const [userId, setUserId] = useState(null);
  return userId ? <Chat userId={userId} /> : <Login onLogin={setUserId} />;
}

export default App;
